import React, { Component } from 'react';
import { Segment, Header } from "semantic-ui-react";

class DataDisplay extends Component {

    render(){
        const { recieveData, currentData } = this.props;
        const { flightData } = currentData;
        if(!flightData) return null;
        return (
            <div style={{ width: "100%", overflow: "hidden", fontSize: "12pt" }}>
                <table id="flight_data_table">
                    <tbody>
                        <tr>
                            <td>Latitude</td>
                            <td>{flightData.latitude}</td>
                        </tr>
                        <tr>
                            <td>Lontitude</td>
                            <td>{flightData.longitude}</td>
                        </tr>
                        <tr>
                            <td>Altitude GSP (ft)</td>
                            <td>{Math.round(flightData.altitude*100)/100}</td>
                        </tr>
                        <tr>
                            <td>Velocity (m/s)</td>
                            <td>{flightData.velocity}</td>
                        </tr>
                        <tr>
                            <td>Bearing</td>
                            <td>{flightData.bearing}</td>
                        </tr>
                        <tr>
                            <td>TimeElapsed</td>
                            <td>{currentData.timeElapsed}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default DataDisplay;
